import React from 'react'
import { useNavigate } from 'react-router-dom';
import { AllSymptoms } from '../symptoms'

const Table = ({ data }) => {

  const navigate = useNavigate();

  return (
    <table>
        <tbody>
            <tr className='titles'>
                <th>დაავადება</th>
                <th>სიმპტომები</th>
            </tr>
            {data.length !== 0 ? data.filter((el) => {
              AllSymptoms.map((symptom) => {
                return el.symptoms.includes(symptom.symptom) && symptom.checkStatus === true;
              })
            }).map(item=>(
            <tr key={item.id}>
                <td><a onClick={() => navigate('/disease', { state: { 
                  data: item
                 } })}>{item.disease}</a></td>
                <td>{item.symptoms.map((el, index) => {
                  return index === item.symptoms.length - 1 ? el : el + ", ";
                })}</td>
            </tr>
            )): <td>დაავადება ვერ მოიძებნა...</td>}
        </tbody>
    </table>
  )
}

export default Table
